import React from 'react';
import './App.css';

class App extends React.Component{

  constructor (props) {
    super(props)
    this.state = {
      items: [],
      isLoaded: false,
    }
  }

componentDidMount (){
  fetch('https://jsonplaceholder.typicode.com/users')
  .then(res => res.json())
  .then (json => {

      this.setState ({
          isLoaded:true,
          items: json,

      })

  }); 
}

render (){

  var {isLoaded, items} = this.state;

  if(!isLoaded){

    return <div>Loading..........</div>
  }else{
    return(
     <div className ="App">
      Data has been Loader
      <p></p>
        <button>Data post</button>
        <ul>
          {items.map(item => (
            <li key={item.id}>
              name:{item.name} | Email: {item.email}
            </li>
          ))};
        </ul>
    </div>
    );
  }

  }
} 

export default App;
